import axios from "axios";

export const axiosNhl = axios.create({
  baseURL: "https://api-web.nhle.com/v1",
  headers: {'Content-Type': 'application/json;charset=UTF-8', 'Sec-Fetch-Site':'cross-site', 'Access-Control-Allow-Origin' : 'http://localhost:3000/'}
});
